import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './components/header';
import TodoInput from './components/todoInput';

function App() {
  return (
    <div className="App">
      <div className="todo-wrapper">
        <Header />
        <TodoInput todoText="" addTodo={this.addTodo}/>
      </div>
    </div>
  );
}

export default App;
